To solve this problem, we need to find the digit immediately after the rightmost 'w' in the given string. Here's the step-by-step approach:

1. **Identify the rightmost 'w':** We need to locate the position of the last 'w' in the string.
2. **Check the character immediately after 'w':** Once we have the position of the last 'w', we look at the character directly following it.

Let's implement this in Python:

```python
def find_digit_after_w(input_string):
    # Find the index of the last 'w'
    last_w_index = input_string.rfind('w')

    # Check if there is a character after the last 'w'
    if last_w_index != -1:
        # Get the character after the last 'w'
        after_w_char = input_string[last_w_index + 1]
        # Convert the character to its corresponding digit (if it's a digit)
        if after_w_char.isdigit():
            return int(after_w_char)
        else:
            return None
    else:
        return None

